import React from 'react';
import styles from "./MainContent.module.css"
import Note from "./Note/Note";

const MainContent = () => {
    return (
        <div className={styles.wrapper}>
            <Note/>
            <Note/>
            <Note/>
            <Note/> <Note/>
            <Note/>
            <Note/>
            <Note/> <Note/>
            <Note/>
            <Note/>
            <Note/>
        </div>
    );
};

export default MainContent;
